import React, { useState } from "react";
import "./Header.scss";
import Settings from "../Settings/Settings";
import { Link } from "react-router-dom";
import HeaderLogo from "../../assets/images/sound-waves.png";
import ExpandArrow from "../../assets/images/Expand_Arrow.png";
import spotifyWebApi from 'spotify-web-api-node';



function Header() {
  const spotifyApi = useRef(
    new spotifyWebApi({
      clientId: "6ba0cc8b29e145ea99f2401c09a35e6e",
    })
  );
  return (
    <div className="header">
      <div className="header__container">
        <Link to="/login">
          <div className="header__wrapper">
            <img
              className="header__container--logo"
              src={HeaderLogo}
              alt="logo"
            />
            <h1>Soundtrack Analyzer</h1>
            <Settings />
          </div>
        </Link>
      </div>
    </div>
  );
}

export default Header;
